export default (state, action) => {
    switch (action.type) {
      case 'Set-Task-Data':
        return { ...state, items: action.data };
        case 'Set-Complete-Data':
        return { ...state, Cdata: action.data };
        case 'Set-Add-Data':
        return { ...state, Ddata: action.data };
      default:
        return state;
    }
  };
